    "introduction": "تم تطوير تطبيق كيورا للجوال من قبل ممارسين طبيين معتمدين يحاولان تقريب المسافة وتبسيط عملية اختيار التخصص الطبي المناسب لشكوى المريض.",
    "privacyPolicy": "قام فريق كيورا ببناء تطبيق كيورا موبايل كتطبيق مجاني. يتم توفير هذه الخدمة من قبل فريق كيورا مجانًا في الوقت الحالي.\nحيث تُستخدم هذه الصفحة لإعلام الزائرين بشأن سياساتنا بجمع المعلومات الشخصية واستخدامها والكشف عنها إذا قرر أي شخص استخدام خدمتنا.\nإذا اخترت استخدام خدمتنا ، فأنت توافق على جمع واستخدام المعلومات المتعلقة بهذه السياسة. تُستخدم المعلومات الشخصية التي نجمعها لتوفير الخدمة وتحسينها.\n لن نستخدم أو نشارك معلوماتك مع أي شخص باستثناء ما هو موضح في سياسة الخصوصية هذه.\nإخلاء المسؤولية: التطبيق غير مصمم لتشخيص المرضى أو علاجهم ، والغرض الوحيد منه هو تقريب المسافة بين المريض والطبيب المتخصص الأكثر ملاءمة لمشكلة المريض الطبية. إذ لا يُقصد بالمواد المطروحة في التطبيق بأي حال من الأحوال أن تحل محل الرعاية الطبية المهنية أو عناية ممارس مؤهل.\nالاستخدام\nتم تصميم كيورا موبايل ليتم استخدامه من قبل نوعين من المستخدمين ، المرضى والأطباء ويتطلب كلاهما إدخال البيانات\n معلومات إلزامية\n يرجى ملاحظة أن خدمات الهاتف المحمول الخاصة بكيورا متاحة فقط لبلد العراق في الوقت الحالي. يجب أن يكون لديك رقم جوال صالح في العراق لتتمكن من التسجيل في هذه الخدمة.\nلن يتم جمع معلومات المرضى مثل العمر والشكاوى والتاريخ الطبي والموقع الجغرافي في الوقت الفعلي بأي وسيلة.\nمعلومات الأطباء مثل الاسم والتخصص ومعلومات الملف الشخصي الأخرى ذات الصلة مطلوبة للتسجيل ولكي تعمل خدمة التطبيق.\n لن تتمكن كيورا موبايل من تقديم الخدمة للمستخدمين الذين يرغبون في عدم تقديم المعلومات المذكورة أعلاه.\nالمعلومات التي نجمعها من الأطباء\n قد نقوم بجمع ومعالجة المعلومات التالية عنك:\nالمعلومات (مثل الاسم والتخصص وعنوان العيادة ورقم هاتف العيادة) التي تقدمها بالتسجيل كمستخدم للهاتف المحمول كيورا.\nفيما يتعلق بمنشأة تسجيل الدخول إلى الحساب ، تفاصيل تسجيل الدخول وكلمة المرور الخاصة بك.\nالمراسلات التي ترسلها إلينا ، على سبيل المثال للإبلاغ عن مشكلة أو لإرسال استفسارات أو مخاوف أو تعليقات بخصوص كيورا والميزات.\nأنت غير ملزم بتقديم أي من هذه المعلومات. ومع ذلك ، إذا اخترت حجب المعلومات المطلوبة ، فقد لا نتمكن من تزويدك بأي خدمات متاحة على كيورا موبايل أو من خلاله.\nبيانات موقع الطبيب\nقد نقوم بجمع المعلومات من خلال كيورا موبايل باستخدام خرائط جوجل لتقديم خدمات الموقع عند الطلب ويجب عليك الموافقة من أجل تقديم محتوى أو إعلانات أو خدمات أخرى تعتمد على معرفة مكانك. يمكنك إلغاء الاشتراك في أي وقت للسماح لنا بالوصول الإضافي إلى بيانات موقعك عن طريق ضبط الإعدادات على جهازك المحمول. يمكنك أيضًا إيقاف جمع بيانات الموقع بالكامل عن طريق إلغاء تثبيت تطبيق الجوال ، باستخدام عمليات إلغاء التثبيت القياسية لجهازك المحمول.\nالاستخدامات المصنوعة من معلومات الطبيب\nنستخدم معلوماتك الشخصية التي نجمعها من أجل:\nتمكننا من تزويد المرضى بالخدمات ومعلومات الطبيب المقدمة من خلال كيورا موبايل.\nإدارة حسابك معنا.\nتدقيق في تنزيل كيورا للجوال\nقم بتحسين تخطيط و / أو محتوى صفحات كيورا موبايل وميزاتها وتخصيصها للمستخدمين.\nالتعرف على زوار كيورا للجوال.\nقم بإجراء بحث عن التركيبة السكانية وسلوك مستخدمينا.\nجمع وتخزين المعلومات الخاصة بك\nيتم إرسال المعلومات التي ترسلها إلى تطبيق كيو وتخزينها على Google Firebase Platform. عندما ننقل معلوماتك ، سنتخذ جميع الخطوات المعقولة لضمان استمرار حماية حقوق الخصوصية الخاصة بك بما يتفق مع التزاماتنا بموجب القانون المحلي. من خلال تقديم المعلومات عبر التطبيق ، فإنك توافق على هذا التخزين والمعالجة و / أو النقل.\nيستخدم التطبيق خدمات الجهات الخارجية التي قد تجمع المعلومات المستخدمة لتحديد هويتك. رابط لسياسة الخصوصية لمقدمي خدمات الطرف الثالث الذين يستخدمهم التطبيق:\nخدمات جوجل بلاي\nGoogle Analytics for Firebase\nFirebase Crashlytics\nتأكيد صحة البيانات\nلقد عمل فريق كيورا بجد لمنع وصول المعلومات المزيفة إلى المستخدمين ، واتخذنا سلسلة من الخطوات لمنع ذلك ، أولاً يجب على أي مستخدم يرغب في التسجيل كطبيب أن يجتاز ثلاثة أسئلة حالة طبية للدخول في عملية التسجيل ، وثانيًا حتى إذا قدمت بريدًا إلكترونيًا آخر ، فلن يُسمح لك بالتسجيل بنفس المعلومات ، وثالثًا سيتم فحص المعلومات المقدمة ومقارنتها بالبيانات التي تم جمعها من مسح المنطقة المحلية لتوفير معلومات صالحة للمرضى ومنع إساءة استخدام البيانات.\nان أي محتوى مرفوض أو غير لائق ،والذي  يمكنك الإبلاغ عنه ، وسنبدأ بمراجعته واتخاذ الإجراءات اللازمة.\nيمكن تعديل بياناتنا التي تم جمعها من مسوحات المنطقة المحلية ، وهذا يعني أنه يمكن إضافة أي طبيب لديه هوية صالحة إلى قاعدة البيانات عن طريق الاتصال بنا ، وتقديم المعلومات اللازمة للتحقق من صحة بياناته.\nسلامة الاطفال\nحماية سلامة الأطفال عند استخدامهم للإنترنت أمر مهم بالنسبة لنا. كيورا للجوال مخصص للاستخدام فقط من قبل الأشخاص الذين تبلغ أعمارهم 18 عامًا على الأقل.  حقوقك\nلديك حق قانوني بموجب قانون حماية البيانات في المملكة المتحدة لعام 1998 و / أو اللائحة العامة لخصوصية البيانات في الاتحاد الأوروبي (GDPR) للحصول على نسخة من جميع المعلومات الشخصية الخاصة بك التي نحتفظ بها لدينا. عند الطلب ، سنزودكم بنسخة من هذه المعلومات. لديك أيضًا الحق في تصحيح أي أخطاء في تلك المعلومات. لديك أيضًا الحق في حذف هذه المعلومات ، ولكن في هذه الحالة قد نضطر بالضرورة إلى إغلاق حسابك.\nحماية وتأمين البيانات\nيلتزم فريق كيورا بتأمين بياناتك والحفاظ على سريتها. بذل فريق كيورا كل ما في وسعه لمنع سرقة البيانات والوصول غير المصرح به والكشف عنها من خلال تطبيق أحدث التقنيات والبرامج التي تساعدنا في حماية جميع المعلومات التي نجمعها عبر الإنترنت.\nلن يقوم فريق كيورا بتأجير أو بيع أو توزيع معلوماتك الشخصية إلى أي طرف ثالث ، ما لم نحصل على إذن منك. قد نفعل ذلك إذا أجبرنا القانون. سيتم استخدام معلوماتك الشخصية عندما نحتاج إلى إرسال مواد ترويجية إليك إذا كنت توافق على سياسة الخصوصية هذه.\nخطط العمل\nكيورا للجوال هو تطبيق مجاني في الوقت الحالي ويمكن لأي مستخدم تحميله مجانًا. ولكن هذه ليست مشكلة نهائية ، فقد نغير خطط أعمالنا في المستقبل ، وقد تكون قائمة على الإعلانات أو تعتمد على الاشتراك بشرط أن يتم تقديم نفس الخدمات لأي مستخدم قام بالتسجيل مسبقًا ولن تتم إزالته بعد تغيير خطة العمل.\nالتغييرات على سياسة الخصوصية هذه\nقد نقوم بتحديث سياسة الخصوصية الخاصة بنا من وقت لآخر. وبالتالي ، يُنصح بمراجعة هذه الصفحة بشكل دوري لمعرفة أي تغييرات ، و سنخبرك  بأي تغييرات عن طريق نشر سياسة الخصوصية الجديدة على هذه الصفحة.",
    "terms_conditions_details": "عن طريق تنزيل التطبيق أو استخدامه، ستنطبق هذه الشروط تلقائيًا عليك - لذلك يجب عليك التأكد من قراءتها بعناية قبل استخدام التطبيق. لا يُسمح لك بنسخ أو تعديل التطبيق أو أي جزء من التطبيق أو علاماتنا التجارية بأي شكل من الأشكال. لا يُسمح لك بمحاولة استخراج الكود المصدري للتطبيق ، ولا يجب أيضًا محاولة ترجمة التطبيق إلى لغات أخرى أو إنشاء إصدارات مشتقة. لا يزال التطبيق نفسه وجميع العلامات التجارية وحقوق النشر وحقوق قواعد البيانات وحقوق الملكية الفكرية الأخرى المتعلقة به مملوكة لفريق كيورا للجوال. \nيلتزم فريق كيورا بضمان أن يكون التطبيق مفيدًا وفعالًا قدر الإمكان. لهذا السبب ، نحتفظ بالحق في إجراء تغييرات على التطبيق أو فرض رسوم على خدماته في أي وقت ولأي سبب. لن نفرض عليك رسومًا مقابل التطبيق أو خدماته أبدًا دون توضيح ما تدفع مقابله بالضبط. \nيقوم تطبيق كيورا بتخزين ومعالجة البيانات الشخصية التي قدمتها إلينا من أجل تقديم خدماتنا. تقع على عاتقك مسؤولية الحفاظ على أمان هاتفك والوصول إلى التطبيق. لذلك نوصيك بعدم كسر الحماية أو عمل روت لهاتفك ، وهي عملية إزالة قيود البرامج والقيود التي يفرضها نظام التشغيل الرسمي لجهازك. يمكن أن يجعل هاتفك عرضة للبرامج الضارة / الفيروسات / البرامج الضارة ، ويهدد ميزات أمان هاتفك وقد يعني أن تطبيق كيورا  لن يعمل بشكل صحيح أو لن يعمل على الإطلاق. \nيستخدم التطبيق خدمات الجهات الخارجية التي تعلن عن الشروط والأحكام الخاصة بها.\nGoogle play services\nGoogle Analytics for Firebase \nيجب أن تدرك أن هناك أشياء معينة لن تتحمل كيورا موبايل مسؤوليتها. تتطلب بعض وظائف التطبيق أن يكون للتطبيق اتصال إنترنت نشط. يمكن أن يكون الاتصال عبر Wi-Fi أو مقدمًا من مزود شبكة الهاتف المحمول الخاص بك ، ولكن لا يمكن لـ كيورا للجوال تحمل مسؤولية التطبيق الذي لا يعمل بكامل وظائفه إذا لم يكن لديك وصول إلى Wi-Fi ، ولم يكن لديك أي من ترك بدل البيانات الخاص بك. \nإذا كنت تستخدم التطبيق خارج منطقة مزودة بشبكة Wi-Fi ، فيجب أن تتذكر أن شروط الاتفاقية مع مزود شبكة الجوال الخاص بك ستظل سارية. نتيجة لذلك ، قد يتم تحميلك من قبل مزود خدمة الهاتف المحمول الخاص بك مقابل تكلفة البيانات طوال مدة الاتصال أثناء الوصول إلى التطبيق ، أو رسوم الطرف الثالث الأخرى. عند استخدام التطبيق ، فأنت تقبل المسؤولية عن أي من هذه الرسوم ، بما في ذلك رسوم بيانات الجوال إذا كنت تستخدم التطبيق خارج إقليمك الأصلي (أي المنطقة أو البلد) دون إيقاف بيانات الهاتف . إذا لم تكن قد دفعت الفاتورة للجهاز الذي تستخدم التطبيق عليه ، فيرجى العلم أننا نفترض أنك تلقيت إذنًا من دافع الفاتورة لاستخدام التطبيق. على نفس المنوال ، لا تستطيع كيورا دائمًا تحمل المسؤولية عن طريقة استخدامك للتطبيق ، أي أنك تحتاج إلى التأكد من بقاء جهازك مشحونًا - إذا نفدت البطارية ولا يمكنك تشغيله للاستفادة من الخدمة ، كيورا للجوال لا تقبل المسؤولية. \nفيما يتعلق بمسؤولية كيورا للجوال عن استخدامك للتطبيق ، عند استخدامك للتطبيق ، من المهم أن تضع في اعتبارك أنه على الرغم من أننا نسعى لضمان تحديثه وصحته في جميع الأوقات ، فإننا نعتمد على الجهات الخارجية تقديم المعلومات إلينا حتى نتمكن من إتاحتها لك. لا تتحمل كيورا أي مسؤولية عن أي خسارة ، مباشرة أو غير مباشرة ، تتعرض لها نتيجة الاعتماد كليًا على وظيفة التطبيق هذه. \nفي مرحلة ما ، قد نرغب في تحديث التطبيق. التطبيق متاح حاليًا على نظامي Android و iOS - قد تتغير متطلبات كلا النظامين (وأي أنظمة إضافية نقرر تمديد توفر التطبيق عليها) ، و ستحتاج إلى تنزيل التحديثات إذا كنت تريد الاستمرار في استخدام التطبيق. لا يعد تطبيق كيورا للجوال بأنه سيحدّث التطبيق دائمًا بحيث يكون مناسبًا لك و / أو يعمل مع إصدار Android و iOS الذي قمت بتثبيته على جهازك. ومع ذلك ، فإنك تتعهد بقبول تحديثات التطبيق دائمًا عند عرضها عليك ، وقد نرغب أيضًا في التوقف عن توفير التطبيق ، وقد ننهي استخدامه في أي وقت دون إشعار الإنهاء لك. ما لم نخبرك بخلاف ذلك ، عند أي إنهاء ، (أ) تنتهي الحقوق والتراخيص الممنوحة لك في هذه الشروط ؛ (ب) يجب عليك التوقف عن استخدام التطبيق ، و (إذا لزم الأمر) حذفه من جهازك. \nقد نقوم بتحديث الشروط والأحكام الخاصة بنا من وقت لآخر. وبالتالي ، يُنصح بمراجعة هذه الصفحة بشكل دوري لمعرفة أي تغييرات. سنعلمك بأي تغييرات عن طريق نشر الشروط والأحكام الجديدة على هذه الصفحة.",
