    "introduction": "Cura mobile app is developed by two certified medical practitioners trying to approximate distance and simplifying  the process of choosing the right medical specialty for the patient complaint.",
    "privacyPolicy": "Cura team built Cura mobile as a Free app. This SERVICE is provided by the cura team at no cost for the time being.\nThis page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.\nIf you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.\nDisclaimer: the app is not designed to diagnose or treat patients, the sole purpose of it is to approximate distance between a patient and a doctor with a speciality that is most appropriate to the patient’s medical problem. The material is in no way intended to replace professional medical care or attention by a qualified practitioner.\nUsage \nCura mobile is designed to be used by two types of users, patients and doctors and both require data input\nMandatory Information\nPlease note that the cura  mobile services are only available for the IRAQ country for now. You need to have a valid IRAQ mobile number to be able to register for this service.\nPatients information such as Age, complaints, medical history, and real time geo-location ARE NOT COLLECTED BY ANY MEANS.\nDoctors Information such as name, speciality, and other related profile information are required for registration and for the app service to function.\n Cura mobile will not be able to provide service to users who wish to not provide the above information.\nInformation we collect from doctors\nWe may collect and process the following information about you:\nInformation (such as your name, speciality, clinic address and clinic phone number) that you provide by registering as a user of the Cura mobile.\nIn connection with an account sign-in facility, your log-in and password details.\nCommunications you send to us, for example to report a problem or to submit queries, concerns or comments regarding Cura mobile and Features.\nYou are under no obligation to provide any such information. However, if you should choose to withhold requested information, we may not be able to provide you with any services available on or through Cura mobile.\nDoctor location data\nWe may collect information through Cura mobile using google maps to provide location services where requested or agreed to by you in order to deliver content, advertising or other services that are dependent on knowing where you are. You may opt out at any time from allowing further access by us to your location data by adjusting the settings on your mobile device. You can also stop all location data collection by uninstalling the mobile app, using the standard uninstall processes for your mobile device.\nUses made of doctor information \nWe use your personal information which we collect to:\nEnable us to provide patients with the Services and doctor information offered through Cura mobile.\nAdminister your account with us.\nAudit the downloading of Cura mobile\nImprove the layout and/or content of the pages of the Cura mobile and Features and customise them for users.\nIdentify visitors to Cura mobile.\nCarry out research on our users' demographics and behavior.\nCollection and storage of your information\nInformation that you submit via Cura mobile is sent to and stored on Google Firebase Platform. When we transfer your information we will take all reasonable steps to ensure that your privacy rights continue to be protected consistent with our obligations under local law. By submitting information via the app, you agree to this storing, processing and/or transfer.\nThe app does use third party services that may collect information used to identify you. Link to privacy policy of third party service providers used by the app:\nGoogle Play Services \nGoogle Analytics for Firebase \nFirebase Crashlytics\nData validation\nCura team had worked so hard to prevent fake information from being delivered to users, we took a series of steps to prevent this , first any user who want to register as a doctor should pass a three medical case questions to enter registration process, second even if you provided a another email, you will not be allowed to register with the same information, and third the information provided will be checked and compared with data collected from local area survey to provide valid information to patients and to prevent data abuse.\nOur data collected from local area surveys can be modified, that means, any doctor who has a valid ID can be added to the database by contacting us, and providing the necessary information for his data validation.\nAny content that is objectionable or inappropriate, you can report it, we will start reviewing it and take the necessary action.\nChild safety\nProtecting the safety of children when they use the Internet is important to us. Cura mobile is intended for use only by persons who are at least 18 years of age.\nYour rights\nYou have a legal right under the U.K. Data Protection Act 1998 and/or and the EU General Data Privacy Regulation (GDPR) to a copy of all the personal information about you held by us. On request, we will provide you with a copy of this information. You also have a right to correct any errors in that information. You also have the right to delete that information, but in that case we may necessarily have to close your account.\nSafeguarding and Securing the Data\nCura team  is committed to securing your data and keeping it confidential. The Cura team has done all in its power to prevent data theft, unauthorized access, and disclosure by implementing the latest technologies and software, which help us safeguard all the information we collect online.\nCura team will not lease, sell or distribute your personal information to any third parties, unless we have your permission. We might do so if the law forces us. Your personal information will be used when we need to send you promotional materials if you agree to this privacy policy.\nBusiness plans\nCura mobile is a free app for now and any user can download it for free. but that is not a final issue, we may change our business plans in the future , it could be an Ad-based or subscription based providing that any user who signed up previously will be offered the same services and will not be removed after changing our plans.\nChanges to This Privacy Policy\nwe may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes.we will notify you of any changes by posting the new Privacy Policy on this page.",
    "terms_conditions_details": "By downloading or using the app, these terms will automatically apply to you – you should make sure therefore that you read them carefully before using the app. You’re not allowed to copy, or modify the app, any part of the app, or our trademarks in any way. You’re not allowed to attempt to extract the source code of the app, and you also shouldn’t try to translate the app into other languages, or make derivative versions. The app itself, and all the trade marks, copyright, database rights and other intellectual property rights related to it, still belong to Cura Mobile.\nCura team  is committed to ensure that the app is as useful and efficient as possible. For that reason, we reserve the right to make changes to the app or to charge for its services, at any time and for any reason. We will never charge you for the app or its services without making it very clear to you exactly what you’re paying for.\nThe Cura app stores and processes personal data that you have provided to us, in order to provide our Service. It’s your responsibility to keep your phone and access to the app secure. We therefore recommend that you do not jailbreak or root your phone, which is the process of removing software restrictions and limitations imposed by the official operating system of your device. It could make your phone vulnerable to malware/viruses/malicious programs, compromise your phone’s security features and it could mean that the Cura app won’t work properly or at all.\nYou should be aware that there are certain things that Cura mobile will not take responsibility for. Certain functions of the app will require the app to have an active internet connection. The connection can be Wi-Fi, or provided by your mobile network provider, but Cura mobile  cannot take responsibility for the app not working at full functionality if you don’t have access to Wi-Fi, and you don’t have any of your data allowance left. \nIf you’re using the app outside of an area with Wi-Fi, you should remember that your terms of the agreement with your mobile network provider will still apply. As a result, you may be charged by your mobile provider for the cost of data for the duration of the connection while accessing the app, or other third party charges. In using the app, you’re accepting responsibility for any such charges, including roaming data charges if you use the app outside of your home territory (i.e. region or country) without turning off data roaming. If you are not the bill payer for the device on which you’re using the app, please be aware that we assume that you have received permission from the bill payer for using the app.\nAlong the same lines, Cura cannot always take responsibility for the way you use the app i.e. You need to make sure that your device stays charged – if it runs out of battery and you can’t turn it on to avail the Service, Cura mobile  cannot accept responsibility.\nWith respect to Cura mobile responsibility for your use of the app, when you’re using the app, it’s important to bear in mind that although we endeavour to ensure that it is updated and correct at all times, we do rely on third parties to provide information to us so that we can make it available to you. Cura mobile accepts no liability for any loss, direct or indirect, you experience as a result of relying wholly on this functionality of the app.\nAt some point, we may wish to update the app. The app is currently available on Android & iOS – the requirements for both systems(and for any additional systems we decide to extend the availability of the app to) may change, and you’ll need to download the updates if you want to keep using the app. Cura mobile does not promise that it will always update the app so that it is relevant to you and/or works with the Android & iOS version that you have installed on your device. However, you promise to always accept updates to the application when offered to you, We may also wish to stop providing the app, and may terminate use of it at any time without giving notice of termination to you. Unless we tell you otherwise, upon any termination, (a) the rights and licenses granted to you in these terms will end; (b) you must stop using the app, and (if needed) delete it from your device.\nWe may update our Terms and Conditions from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Terms and Conditions on this page.",
